import { NavLink } from "react-router-dom";
// import SearchBar from "./SearchBar";
// import SearchBox from "./Searchbox";
// import searchicon from "../assests/search-icon.png";
// import Home from "./Home";
export default function Navbar() {
    return (
        <div className="navbar p-[20px] bg-[purple] w-[100%]">
            <nav className="flex justify-between w-[100%]">
                <div>
                    <h1 className="bg-linear-to-r from-yellow-200 via-amber-400 to-orange-600 bg-clip-text text-transparent  font-extrabold text-[24px]">GOVLAW</h1>
                </div>
                <div className="flex gap-[20px]">
                    <button className="bg-[oklch(0.76_0.07_260.19)] text-white pt-[10px] pb-[10px] rounded-[8px]">Login</button>
                    <button className="bg-[oklch(0.76_0.07_260.19)] text-white pt-[10px] pb-[10px] rounded-[8px]">Get Started</button>
                </div>
            </nav>
        </div>
    );
}
